import React from 'react';
import './SellCropVisual.css'; 
import { useNavigate } from 'react-router-dom';

const SellCropVisual = () => {
    const navigate = useNavigate();

    const handleNavigate = () => {
        navigate('/vendors')
    }

  return (
    <>
    <div className='home'>
        <div>
            <h2>Platform where farmers can sell crops to vedors</h2>
            <h3>Main aim is to:</h3>
            <h4><ol>remove Middleman.</ol></h4>
            <h4><ol>provide farmer more knowledge.</ol></h4>
            <h4><ol>make farmers's daily activities easier.</ol></h4>
            <h4><ol>provide updates to  the farmer.</ol></h4>
        </div>

        <div>
            <button onClick={handleNavigate}>Sell your Crops</button>
        </div>
        
    </div>
    
    </>
  );
};

export default SellCropVisual;
